import React, { Component } from 'react';
import "bulma/css/bulma.css";
import '../MainPage.css';
import { Route } from "react-router";
import imageOne from '../Images/Profile.JPG'
import family from '../Images/Family.JPG'

import Carousel, { Dots } from '@brainhubeu/react-carousel';
import Image from 'react-image-resizer';

class About extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div class="card" style={{borderRadius:"2px", marginRight:"10%", marginLeft:"10%"}}>
      <div class="card" style={{borderRadius:"2px white", padding:"5%", boxShadow: "0px 0px"}}>
        <div class="title is-3">
          Hello! I'm Brendan!
        </div>
        <div class="title is-5">
          I'm a software developer. In fact, I have created this website using ReactJs!
          <br/>
          <br/>
          In May of 2020, I will graduate with a B.S. in Computer Engineering from Virginia Tech. Here, I have had amazing opportunities to enhance my software developing skills.
          <br/>
          <br/>
          Through my coursework, I have become proficient in C++, Python, and C, as well as techniques in artificial intelligence and machine learning. During my time in school, I have taken courses in data structures and applied software design, as well as control systems and embedded software design. I also have experience in the coding of microcontrollers. At the same time, I have experience in industry interning with companies such as Optum where I have been able to further my skill set. Here I have learned NoSQL database design in the form of graphing databases as well as frontend web design using ReactJS. Through the combination of these experiences I have been able to obtain, I am excited to pursue a career in this field.

Beyond my technical skills, I have many personal qualities that help me perform in a professional environment. Two words that describe me are communicative and determined. In conversations, I always want to make sure everyone is heard and given a chance to provide input. The more opinions we have the better the product will be. My determination leads me to want to get my work done fast and not let obstacles stand in my way. In an agile environment I make sure my user stories are completed and can then go help teammates. I believe the combination of these personality traits make me a great fit for this company.

I will deeply appreciate any consideration you offer my application. If you desire additional information, please feel free to contact me at brendmm@vt.edu, or (978) 270-4538.

Respectfully,

Brendan Muldowney

        </div>
      </div>
      </div>
    );
  }
}

export default About;

